import React from 'react'
import PropTypes from 'prop-types'

function Header({text}) {

  const headerStyle = {
    backgroundColor:'blue',
    color:'red'
  }
  return (
    <header>
        <div className='container' style={headerStyle}>
            <h2>{text}</h2>
      </div>
    </header>

  )
}

Header.propTypes = {
    text: PropTypes.string
}

Header.defaultProps = {
    text:'Feedback UI'
}

export default Header
